column2:
b'<h4>Default Template</h4>
<p>Uses <a href="http://jinja.pocoo.org/docs/templates/">Jinja Templating</a> and all the fields of Address (including Custom Fields if any) will be available</p>
<pre><code>{{ address_line1 }}&lt;br&gt;
{% if address_line2 %}{{ address_line2 }}&lt;br&gt;{% endif -%}
{{ city }}&lt;br&gt;
{% if state %}{{ state }}&lt;br&gt;{% endif -%}
{% if pincode %} PIN:  {{ pincode }}&lt;br&gt;{% endif -%}
{{ country }}&lt;br&gt;
{% if phone %}Phone: {{ phone }}&lt;br&gt;{% endif -%}
{% if fax %}Fax: {{ fax }}&lt;br&gt;{% endif -%}
{% if email_id %}Email: {{ email_id }}&lt;br&gt;{% endif -%}
</code></pre>'

column3:
b'<H4> Modello predefinito </ h4> 
 <p> <a Usi href="http://jinja.pocoo.org/docs/templates/"> Jinja Templating </a> e tutti i campi di Indirizzo ( compresi campi personalizzati se presente) sar\xc3\xa0 disponibile </ p> 
 <pre> <code> {{address_line1}} & lt; br & gt; 
 {% se address_line2%} {{address_line2}} & lt; br & gt; { % endif -%} 
 {{city}} & lt; br & gt; 
